import axios from "../Dall/axios-instance";

export const friendsService = {
    getUsers: (returnCount, currentPage) => {
        axios.get(`users?count=${returnCount}&page=${currentPage}`).then(
            (result) => {
                return result.data
            }
        )
    }
}
